import React from 'react';

const ItemGrid =  {
    render() {
        return (
        <>
            <section className='itemgrid'>
                <div className='container grid-three-column'>
                    <div className='card-itemgrid'>
                        <div className='card-img-itemgrid'>
                            {/* <img src={} alt={}/> */}
                        </div>
                        <div className='card-text-itemgrid'>
                            <span className='product'></span>
                            <span className='product'></span>
                        </div>
                    </div>
                </div>
            </section>
        </>
        );
    }
}

export default ItemGrid;
